import React from 'react';

import BulletDescription from './BulletDescription';
import circle from '../images/circle.png';
import timeline from '../images/timeline.png';

const ExperienceRight = props => {
  return (
    <div className="experience-indi">
      <div className="right">
        <img
          className="logo"
          src={props.logo}
          alt={props.company + 'logo'}
          width="150px"
          height="150px"
        />
        <div className="content">
          <h2 className="title">{props.role}</h2>
          <h2 className="company"> &nbsp;@ {props.company}</h2>
          {/* <BulletDescription descriptions={props.descriptions} /> */}
        </div>
      </div>
    </div>
  );
};

export default ExperienceRight;
